import Contactpage from "./pages/Contactpage";
import Homepage from "./pages/Homepage"
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

const App = () => {
  return 
<Router>
  <Switch>
  <Route path="/">
    <Homepage/>
  </Route>
  </Switch>
</Router>
};

export default App;
